    data: |
      SELECT DISTINCT + - ( cor0.col0 ) / cor0.col0 + - col0 * col0 + 0 / + col1 AS col2 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q5433.out
    data: |
      -50
      -6085
      -6242
